import React from 'react';

const Landing = () => {
    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h2>Welcome to the Quiz App</h2>
            <p>Get started by registering or logging in using the links above!</p>
        </div>
    );
};

export default Landing;
